import React from 'react';
import ReactDOM from 'react-dom';
import {BrowserRouter} from 'react-router-dom';
import Home from './core/Home';
impo

ReactDOM.render(
  <React.StrictMode>
    <BrowserRouter>
    <Home />
    <App />
    </BrowserRouter>
  </React.StrictMode>,
  document.getElementById('root')
);
